import React, { useState } from 'react';

import Switch from '@mui/material/Switch';



function BooleanChanger(props){
    console.log(props.vlaue)
    const [value, setValue] = useState(props.value == 'ON' ? true : false);
    const sendChange = () => {//Use opposite since its a switch
        props.onValueChange([props.keyHistory, value == true ? 'OFF' : 'ON']);
    }
    
    const handleChange = (event, newValue) => {
        setValue(newValue);
        sendChange();
    }
    return(
        <Switch sx={{}} disabled={props.isDisabled} checked={value} onChange={handleChange}></Switch>
    )
}

export default BooleanChanger;
